var h4Tags = document.querySelectorAll('h4');

var h4 = [
    "Sloth",
    "DMV Clerk",
    "Fox"
];
var imgTags = document.querySelectorAll('img');
var aTags = document.querySelectorAll('a');
var images = [
    {
        src: "data:image/jpeg;base64,",
        alt: "Image of sloth"
    },
    {
        src: "data:image/jpeg;base64,",
        alt: "Image of DMV clerk"
    },
    {
        src: "data:image/jpeg;base64,",
        alt: "Image of Fox"
    }
];

for(var i = 0; i < h4.length; i++){
    // console.log(h4[i]);
    h4Tags[i].innerText = h4[i];
    // console.log(h4Tags[i]);
}

for(var i = 0; i < images.length; i++){
    // console.log(images[i]);
    // console.log(imgTags[i]);
    imgTags[i].setAttribute("src", images[i].src);
    imgTags[i].setAttribute("alt", images[i].alt);
}

for(var i = 0; i < aTags.length; i++){
    aTags[i].setAttribute("href", "https://youtu.be/x_2E6nlnMPU");
}